sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.step_input_status_code == '200')  {
        var responseObj = JSON.parse(inputs.step_input_response_body);

        // Ensure responseObj.items[0] exists before accessing its properties
        if (responseObj.items && responseObj.items.length > 0) {
            var volumeInfo = responseObj.items[0].volumeInfo;

            // Set output variables
            outputs.step_output_title = volumeInfo.title || '';
            outputs.step_output_authors = volumeInfo.authors ? volumeInfo.authors.join(', ') : '';
            outputs.step_output_publisher = volumeInfo.publisher || '';
            outputs.step_output_publishdate = volumeInfo.publishedDate || '';
            outputs.step_output_description = volumeInfo.description || '';
            outputs.step_output_isbn = volumeInfo.industryIdentifiers && volumeInfo.industryIdentifiers.length > 1 ? volumeInfo.industryIdentifiers[1].type : '';
            outputs.step_output_pagecount = volumeInfo.pageCount || '';
            outputs.step_output_genre = volumeInfo.categories ? volumeInfo.categories.join(', ') : '';
            outputs.step_output_imagelinks = volumeInfo.imageLinks && volumeInfo.imageLinks.thumbnail ? volumeInfo.imageLinks.thumbnail : '';
            outputs.step_output_language = volumeInfo.language || '';
        } 
    }
})(inputs, outputs);

